import React, { Component } from "react";
import "../styles/stylesheet.css";
import News from "../components/News.js";
import MedNews from "../components/MedNews.js";
import SmallNews from "../components/SmallNews.js";
import Card from "../components/Card";
import Row from "../components/Row";
import * as $ from "jquery";

export default class BigNews extends Component {
  render() {
    var newsList = [];
    $.ajax({
      url: "/sak",
      type: "GET",
      dataType: "json",
      success: function(data) {
        data.map(news => {
          newsList.push(
            new Sak(
              news.overskrift,
              news.innhold,
              news.tidspunkt,
              news.bilde,
              news.kategori_id,
              news.viktighet
            )
          );
        });
      },
      async: false
    });
    return (
      <Card>
        {newsList.filter(news => news.viktighet === 1).map(e => newsCard(e))}
      </Card>
    );
  }
}
function newsCard(BigNews: Sak) {
  return (
    <div className="col-sm-4 my-3">
      <h4>{BigNews.overskrift}</h4>
    </div>
  );
}
